import requests
import json
files1 = {'input_image':['',]}
def raise_count(files):
    r = requests.post("http://3.114.109.17/raise_hand_count/", json=json.dumps(files)) # jsonとしてサーバーにPOSTする
    # r = requests.get("http://127.0.0.1:8000/api_person_predict/") # jsonとしてサーバーにPOSTする
    import ast
    dic = ast.literal_eval(json.dumps(r.json()))
    dic = ast.literal_eval((dic)[0])
    print(type(dic["count"]))
    return dic["count"]


if __name__ == "__main__":
    print(raise_count(files1))
